АЗС «ОПТИ» — это новый проект по развитию сети автозаправочных станций – партнеров Газпром нефти. На наших АЗС стабильно высокий уровень сервиса, качество топлива на всей сети АЗС «ОПТИ» контролируется группой компаний «Газпром нефть».

Приложение позволяет:
- активировать и выпускать карту постоянного клиента «ОПТИ» и карты клиентов IT-платформы «ОПТИ» прямо из приложения;
- находить ближайшую АЗС «ОПТИ»;
- получать скидки на топливо;
- узнавать цены на топливо в сети АЗС «ОПТИ» прямо в приложении;
- пользоваться преимуществами карты постоянного клиента;
- просматривать историю заказов по карте постоянного клиента;
- отслеживать лимиты и историю заказов по корпоративной карте;
- просматривать скидки и акции на АЗС.

Спасибо за Ваши отзывы! Мы продолжаем работать над улучшением приложения.
